import React, { useState } from 'react';

const Counter = () => {
    const [count, setCount] = useState(0)
    return (
        <div>
            <h2>{count}</h2>
            <button onClick={() => setCount(count + 1)}>Incre</button>
        </div>
    );
};

export default Counter;
